kers: 20 &lt;/li&gt;\n          &lt;li&gt; Threads: 20 &lt;/li&gt;\n          &lt;li&gt; Memory: 93.20 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom processor.default_accumulators import desired_output, add_processes_to_output\n\nfrom Tools.helpers import get_samples\nfrom Tools.config_helpers import redirector_ucsd, redirector_fnal\nfrom Tools.nano_mapping import make_fileset, nano_mapping\n\nfrom processor.meta_processor import get_sample_meta\n\noverwrite = True\nlocal = False\n\n# load the config and the cache\ncfg = loadConfig()\n\ncacheName = 'charge_flip_calc'\ncache = dir_archive(os.path.join(os.path.expandvars(cfg['caches']['base']), cacheName), serialized=True)\n\nyear = 2018\n\n# get a python dictionary of all NanoAOD samples\n# The samples definitions can be found in data/samples.yaml\nsamples = get_samples()\n\n# make a fileset, taking the definitions in Tools/nano_mapping.py\nfileset = make_fileset(['DY', 'TTZ', 'top',], samples, redirector=redirector_ucsd, small=True)\n#add back in:  \n\n# in order for cutflows to work we need to add every process to the output accumulator\nadd_processes_to_output(fileset, desired_output)\n\nhistograms = sorted(list(desired_output.keys()))\n\nmeta = get_sample_meta(fileset, samples)\n\nchunksize = 25000\n\nif local:\n\n    exe_args = {\n        'workers': 16,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n    }\n    exe = processor.futures_executor\n\nelse:\n    from Tools.helpers import get_scheduler_address\n    from dask.distributed import Client, progress\n    \n    scheduler_address = get_scheduler_address()\n    c = Client(scheduler_address)\n    \n    def unique(filename):\n        file, ext = os.path.splitext(filename)\n        counter = 0\n        while os.path.exists(filename):\n            counter += 1\n            filename = file + str(counter) + ext\n        return filename\n\n    tstart = time.time()\n    \n    from dask.distributed import performance_report\n    fname = unique(\"dask-report_chunksize=\" + str(chunksize/1000) + \"K.html\")\n    \n    exe_args = {\n        'client': c,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n        'savemetrics': True\n    }\n    exe = processor.dask_executor\n\nif not overwrite:\n    cache.load()\n\nif cfg == cache.get('cfg') and histograms == cache.get('histograms') and cache.get('simple_output'):\n    output = cache.get('simple_output')\n\nelse:\n    print (\"I'm running now\")\n    with performance_report(filename=fname):\n        output = processor.run_uproot_job(\n            fileset,\n            \"Events\",\n            charge_flip_calc(year=year, variations=[], accumulator=desired_output),\n            exe,\n            exe_args,\n            chunksize=chunksize,\n            )\n\n    cache['fileset']        = fileset\n    cache['cfg']            = cfg\n    cache['histograms']     = histograms\n    cache['simple_output']  = output\n    cache.dump()\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"axis":{"id":"1012"},"ticker":null,"visible":false},"id":"1015","type":"Grid"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1101","type":"Quad"},{"attributes":{},"id":"1052","type":"BasicTicker"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &l
